import logging
from abc import ABC, abstractmethod
from typing import List, Dict

# Set up logging with a basic configuration
logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(name)s - %(levelname)s - %(message)s')

# Define user types
class User(ABC):
    def __init__(self, username: str):
        self.username = username

    @abstractmethod
    def get_permissions(self) -> List[str]:
        pass

class AgencyUser(User):
    def get_permissions(self) -> List[str]:
        return ['view_agency_data']

class Developer(User):
    def get_permissions(self) -> List[str]:
        return ['view_developer_data', 'edit_developer_data']

class FABSUser(User):
    def get_permissions(self) -> List[str]:
        return ['view_fabs_data', 'edit_fabs_data']

class BrokerUser(User):
    def get_permissions(self) -> List[str]:
        return ['view_broker_data', 'edit_broker_data']

# Define page management
class PageManager:
    def __init__(self):
        self.pages = {}

    def add_page(self, page_id: str, page_content: str):
        self.pages[page_id] = page_content

    def get_page(self, page_id: str) -> str:
        return self.pages.get(page_id, 'Page not found')

# Define submission management
class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def add_submission(self, submission_id: str, submission_data: Dict[str, str]):
        self.submissions[submission_id] = submission_data

    def get_submission(self, submission_id: str) -> Dict[str, str]:
        return self.submissions.get(submission_id, {})

# Define FPDS data management
class FPDSDataManager:
    def __init__(self):
        self.data = {}

    def add_data(self, data_id: str, data: Dict[str, str]):
        self.data[data_id] = data

    def get_data(self, data_id: str) -> Dict[str, str]:
        return self.data.get(data_id, {})

# Define deletion processing
class DeletionProcessor:
    def __init__(self):
        self.deletions = {}

    def process_deletions(self, date: str):
        logging.info(f'Processing deletions for {date}')

# Define error message management
class ErrorMessageManager:
    def __init__(self):
        self.error_messages = {
            'ERROR_1': 'Error message 1',
            'ERROR_2': 'Error message 2',
        }

    def get_error_message(self, error_code: str) -> str:
        return self.error_messages.get(error_code, 'Unknown error')

# Define FABS submission validation
class FABSValidator:
    def __init__(self):
        self.validation_rules = {
            'rule1': lambda x: x > 0,
            'rule2': lambda x: x < 100,
        }

    def validate_submission(self, submission_data: Dict[str, str]) -> List[str]:
        error_messages = []
        for rule, validator in self.validation_rules.items():
            if not validator(submission_data.get('value', 0)):
                error_messages.append(f'Validation error: {rule}')
        return error_messages

