# Define duplicate transaction prevention
class DuplicateTransactionPreventer:
    def __init__(self):
        self.transactions = {}

    def prevent_duplicates(self, transaction_id: str):
        if transaction_id in self.transactions:
            logging.warning(f'Duplicate transaction detected: {transaction_id}')
        else:
            self.transactions[transaction_id] = True

