    # Create page manager
    page_manager = PageManager()
    page_manager.add_page('page1', 'This is page 1')
    print(page_manager.get_page('page1'))

    # Create submission manager
    submission_manager = SubmissionManager()
    submission_manager.add_submission('submission1', {'key': 'value'})
    print(submission_manager.get_submission('submission1'))

    # Create FPDS data manager
    fpds_data_manager = FPDSDataManager()
    fpds_data_manager.add_data('data1', {'key': 'value'})
    print(fpds_data_manager.get_data('data1'))

    # Process deletions
    deletion_processor = DeletionProcessor()
    deletion_processor.process_deletions('2022-01-01')

    # Get error message
    error_message_manager = ErrorMessageManager()
    print(error_message_manager.get_error_message('ERROR_1'))

    # Validate FABS submission
    fabs_validator = FABSValidator()
    print(fabs_validator.validate_submission({'value': 50}))

if __name__ == '__main__':
    main()
